import React from 'react';
import { StyleSheet, View } from 'react-native';

const RatingCard = () => {
    return <View style={styles.wrapper}></View>
}

export default RatingCard

const styles = StyleSheet.create({
    wrapper: {
        width: 400,
        height: 70,
        color: '#f8f1f1'
    }
});
